import Task from "../Task/Task";
import "./Column.scss";

const Column = () => {
	return (
		<>
			<div className='column'>
				<header>To Do:</header>
				<ul className='task-list'>
					<Task></Task>
				</ul>
				<footer>+ New Card</footer>
			</div>
		</>
	);
};

export default Column;
